import React from 'react';
import './Header.css';

const Header = () =>{
    return(
        <div className="rmdm-header">
            <div className="rmdb-header-content">
                <img  className="rmdb-logo" src="./images/reactMovie_logo.png" alt="rmdbImage" />
                <img  className="rmdb-tmdb-logo" src="./images/tmdb_logo.png" alt="tmdbImage" />
            </div>

        </div>
    )
}
export default Header;
